App.Dimension3Route=App.SmartRoute.extend({activate:function(){this._super();this.addEvents({SmartController_didInsertElement:function(a,b){switch(b){case"World3dController":this.world3dController=a;break;case"SubtitleController":switch(a.get("orderRead")){case"instruction":this.subtitleInstructionController=a;break;case"heading":this.subtitleHeadingController=a;break;case"1":this.subtitle1Controller=a;break;case"2":this.subtitle2Controller=a;break;case"art":this.subArtController=a;break;case"award":this.subAwardController=a;break}break;default:break}setTimeout(function(c){return function(){c.tryStart()}}(this),0)},SubtitleController_didInsertElement:function(a,b){},doSubtitle1:function(){},doRotateQuestionMarkHint:function(){this.world3dController.doRotateQuestionMarkHint()},doRotateQuestionMarkInstruction:function(){this.subtitleInstructionController.startReading()},doRotateQuestionMark:function(){this.world3dController.doQuestionMarkRotate()},doQuestionMarkRotateDone:function(){this.subtitleInstructionController.doRemoveClicked();this.subtitle2Controller.startReading();setTimeout(function(a){return function(){a.subArtController.startReading()}}(this),3200);setTimeout(function(a){return function(){a.subAwardController.startReading()}}(this),2400)}})},model:function(){return(App.dimension3Model)?App.dimension3Model:App.Dimension3Model.create()},deactivate:function(){this._super();this.world3dController=null;this.subtitle1Controller=null;this.subAwardController=null;this.subArtController=null;this.subtitleHeadingController=null},renderTemplate:function(){if(App.PRELOADER.isLoaded){this.render("dimension3");this.render("nav-list",{outlet:"nav-list"})}else{App.eventMapper.addEventListener("preloaderIsLoaded",this,function(a){return function(){a.renderTemplate()}}(this))}},tryStart:function(){if(!this.get("isStarted")&&this.subtitleHeadingController&&this.subtitle1Controller&&this.subtitleInstructionController&&this.subtitle2Controller&&this.subArtController&&this.subAwardController){this.set("isStarted",true);this.doStart()}},doStart:function(a,b){this.subtitleHeadingController.startReading();setTimeout(function(c){return function(){c.subtitle1Controller.startReading()}}(this),1800)}});